    const {id,name,email,number,address,dob} = data[user]['details']
    return(
        <div className="card">
         <h1>profile</h1>
         <div className='profile-section'>
    <div className="container"> 
    <div className="form"> 
      <h2>REGISTER ID</h2>
      <h4>{id}</h4>
